import{_ as t,c as a,o,ae as i}from"./chunks/framework.DRno8Cka.js";const n="/RBQ/assets/packing_1.BHZAqPsP.png",r="/RBQ/assets/packing_2.WXOY-yUE.png",s="/RBQ/assets/packing_3.BpstA5_-.png",h="/RBQ/assets/packing_4.RpIgdley.png",l="/RBQ/assets/packing_5.kaBjJdrt.png",p="/RBQ/assets/packing_6.DADYaMks.png",c="/RBQ/assets/packing_7.dW5bzYoB.png",g="/RBQ/assets/packing_8.BXZSv3UV.png",y=JSON.parse('{"title":"Packing","description":"","frontmatter":{"layout":"doc","outline":"deep"},"headers":[],"relativePath":"manual/Operation/packing.md","filePath":"manual/Operation/packing.md","lastUpdated":1750224677000}'),d={name:"manual/Operation/packing.md"};function u(m,e,b,f,k,_){return o(),a("div",null,e[0]||(e[0]=[i('<h1 id="packing" tabindex="-1">Packing <a class="header-anchor" href="#packing" aria-label="Permalink to &quot;Packing&quot;">​</a></h1><p>The RBQ10 is primarily stored and transported using a Pelican case. The model of the Pelican case used is the 1730 Protector Case. Please refer to the images below and store the RBQ10 along with other items accordingly.</p><h2 id="how-to-pack-unpack-robot" tabindex="-1">How to Pack/Unpack robot <a class="header-anchor" href="#how-to-pack-unpack-robot" aria-label="Permalink to &quot;How to Pack/Unpack robot&quot;">​</a></h2><p>The Pelican case is divided into two layers. The lower layer is used to store the charger, spare rubber feet, and the LiDAR, while the RBQ10 is placed on top of them.</p><figure><img src="'+n+'" alt="missing"></figure><p>After placing the components in the bottom layer, transport the robot as shown in the picture and place it inside the case.</p><blockquote><p>⚠️ The robot must be carried by two people working together.</p></blockquote><blockquote><p>⚠️ Before transporting the robot, remove any additional equipment attached to it and turn off the power.</p></blockquote><figure><img src="'+r+'" alt="missing"></figure><p>After placing the RBQ10 on the ground, extend its legs as shown in the illustration.</p><p>The parts of the legs marked in red should be held by two people, each grabbing one, for transportation.</p><figure><img src="'+s+'" alt="missing"></figure><blockquote><p>⚠️ Be careful not to let any foreign objects get into the knee joint rotation area, and ensure fingers do not get pinched!</p></blockquote><figure><img src="'+h+'" alt="missing"></figure><p>Place the robot inside the Pelican 1730 case, ensuring it fits the shape of the case.</p><p>After placing the robot&#39;s body into the case, fold the legs in the following order:</p><h3 id="step-1-fold-the-front-leg-s-knee-joint-all-the-way-in" tabindex="-1">Step 1 : Fold the front leg&#39;s knee joint all the way in <a class="header-anchor" href="#step-1-fold-the-front-leg-s-knee-joint-all-the-way-in" aria-label="Permalink to &quot;Step 1 : Fold the front leg&#39;s knee joint all the way in&quot;">​</a></h3><figure><img src="'+l+'" alt="missing"></figure><h3 id="step-2-rotate-the-front-leg-s-hip-pitch-joint-and-place-the-leg-into-the-groove-of-the-case" tabindex="-1">Step 2 : Rotate the front leg&#39;s hip pitch joint and place the leg into the groove of the case <a class="header-anchor" href="#step-2-rotate-the-front-leg-s-hip-pitch-joint-and-place-the-leg-into-the-groove-of-the-case" aria-label="Permalink to &quot;Step 2 : Rotate the front leg&#39;s hip pitch joint and place the leg into the groove of the case&quot;">​</a></h3><figure><img src="'+p+'" alt="missing"></figure><figure><img src="'+c+'" alt="missing"></figure><h3 id="step-3-rotate-the-back-leg-s-hip-pitch-joint-so-that-the-leg-goes-over-the-front-leg-s-thigh" tabindex="-1">Step 3 : Rotate the back leg&#39;s hip pitch joint so that the leg goes over the front leg&#39;s thigh <a class="header-anchor" href="#step-3-rotate-the-back-leg-s-hip-pitch-joint-so-that-the-leg-goes-over-the-front-leg-s-thigh" aria-label="Permalink to &quot;Step 3 : Rotate the back leg&#39;s hip pitch joint so that the leg goes over the front leg&#39;s thigh&quot;">​</a></h3><h3 id="step-4-fully-extend-the-back-leg-s-shin" tabindex="-1">Step 4 : Fully extend the back leg&#39;s shin <a class="header-anchor" href="#step-4-fully-extend-the-back-leg-s-shin" aria-label="Permalink to &quot;Step 4 : Fully extend the back leg&#39;s shin&quot;">​</a></h3><figure><img src="'+g+'" alt="missing"></figure><p>The remote control is placed in the side compartment of the robot. And the user can use the empty space.</p><p>Finally, close the cover and complete the packing.</p><p>Unpacking is done in reverse order of the above steps.</p><h2 id="packing-dimension" tabindex="-1">Packing Dimension <a class="header-anchor" href="#packing-dimension" aria-label="Permalink to &quot;Packing Dimension&quot;">​</a></h2><p><b>Packing Dimension</b></p><table><tr><th>Case Type</th><th>External Dimensions</th><th>Weight (Empty)</th></tr><tr><td>Pelican 1730 Protector Case</td><td> 37.50 x 27.13 x 14.37&quot; (inch)<br> 86.3 x 60.9 x 31.7 (cm) </td><td> 44 lbs / 20 kg </td></tr></table><h2 id="packing-list" tabindex="-1">Packing List <a class="header-anchor" href="#packing-list" aria-label="Permalink to &quot;Packing List&quot;">​</a></h2><p><b>Packing List</b></p><p>The components may vary depending on the optional items.</p><table><tr><th>Category</th><th>Items</th></tr><tr><td>Standard</td><td> RBQ10 x 1 unit<br> Battery charger x 1 unit<br> Spare rubber foot x 4 ea<br> Spare body bumper<br> Remote controller x 1 unit<br> Basic tools (wrench) x 1 set </td></tr><tr><td>Navigation Pack</td><td> Standard list are included<br> LiDAR module x 1 unit </td></tr></table>',34)]))}const x=t(d,[["render",u]]);export{y as __pageData,x as default};
